import React from "react";
import { Box, Button, Collapse, IconButton, Table, TableBody, TableCell, TableHead, TableRow, Typography } from "@mui/material"

import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';

import axios from "axios";
import { green } from "@mui/material/colors";

export const Linha = ({ row, labelId, dense, largura, serVice, setActiveStep }) => {

    const [open, setOpen] = React.useState(false)

    // console.log(row.servicoSolicitado)

    const funcao = () => {
        setActiveStep(2)
        serVice()
    }


    return (
        <TableRow
            key={row._id}
            hover
        >

            <TableCell sx={{ '& > *': { borderBottom: 'unset' } }}>
            </TableCell>
            <TableCell
                component="th"
                id={labelId}
                scope="row"
                padding="none"
            >
                {row.nome}
            </TableCell>
            <TableCell align="right">{row.dataSolicitacao}</TableCell>
            <TableCell align="right">{row.quantidade}</TableCell>
            <TableCell align="right">{row.situacao}</TableCell>
        </TableRow>
    )
}
